import React from "react";
import "./Login.scss";

const Login = (props) => {
  return (
    <div className="loginContainer">
      <div className="loginWrap">
        <div className="logoWrap"></div>
        <div className="formWrap">
          <form>
            <input type="text" />
            <input type="password" />
            <button className="loginBtn">로그인</button>
          </form>
        </div>
      </div>
      <div>
        <p>계정이 없으신가요?</p>
        <a href="#!">가입하기</a>
      </div>
    </div>
  );
};

export default Login;
